import './Product.style.scss';

const Product = (props) => {
    console.log(props);

    const renderProductImg = () => {
        const { product: { image_url, name }, isLoading } = props;

        if (isLoading) {
            return (
                <div className='Product-ImageBlock'>
                    <div
                        className={ isLoading ? 'Image_placeholder' : 'Image' }
                        src={ image_url || '' }
                        alt={ name }
                        title={ name }
                        loading="lazy"
                    />
                </div>
            );
        }

        return (
            <div className='Product-ImageBlock'>
                <img
                    className={ isLoading ? 'Image_placeholder' : 'Image' }
                    src={ image_url || '' }
                    alt={ name }
                    title={ name }
                    loading="lazy"
                />
            </div>
        );
    }

    return (
        <>
